import style from "./ProductList.module.css"

const ProductList = (props) => {
        console.log(props.nft)
    return (
        <div>
            Here will be NFT list
            {
                props.nft.map(nft => <div key={nft.id} className={style.nftBlock}>
                    <img src={props.nft.imageUrl} className={style.nftImage} />
                    <h3>{props.nft.name || 'none'}</h3>
                    <span>Amount: {props.nft.amount || 'none'}</span>
                    <p>Price: {props.nft.price}$ || 'none'</p>

                </div> )
            }

            <div>{props.nft.name}</div>
        </div>
    )
}

export default ProductList;
